'use strict';
let GetClosedPositionsMessage = require('./GetClosedPositionsMessage.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class GetClosedPositionsMessageBuilder extends GetClosedPositionsMessage {
    addClosedPosition(closedPosition) {
        this.closedPositionsList.add(closedPosition);
    }
    addClosedPositions(closedPositions) {
        let i;
        if (this.closedPositionsList == null) {
            stdlib.print("closedPositionsList == nil");
        }
        if (closedPositions != null) {
            for (i = 0; i <= closedPositions.length() - 1; i += 1) {
                this.closedPositionsList.add(closedPositions.get(i));
            }
        }
    }
    build() {
        return this;
    }
}
module.exports = GetClosedPositionsMessageBuilder
